schema.schema:
{
    "description": "Items inside the event fulfillment-order-service.shipment-created",
    "type": "object",
    "properties": {
        "parent_eid": {
            "format": "uuid",
            "type": "string"
        },
        "parent_metadata_partition": {
            "type": "string"
        },
        "parent_id": {
            "type": "string"
        },
        "value_at_items": {
            "$ref": "#/definitions/Items",
            "type":"object"
        }
    },
    "required": [
        "parent_eid",
        "parent_metadata_partition",
        "parent_id",
        "value_at_items"
    ],
    "definitions": {
        "Items": {
            "required": [
                "id",
                "shipment_order_id",
                "fulfillment_order_id",
                "product",
                "gross_discounted_price",
                "tax",
                "merchant",
                "locale"
            ],
            "type": "object",
            "properties": {
                "merchant": {
                    "type": "string",
                    "description": "Owner of the item."
                },
                "product": {
                    "required": [
                        "id",
                        "description",
                        "size"
                    ],
                    "type": "object",
                    "properties": {
                        "size": {
                            "type": "string",
                            "description": "Product size",
                            "size": "47 2/3"
                        },
                        "description": {
                            "type": "string",
                            "description": "Product name/description"
                        },
                        "id": {
                            "type": "string",
                            "description": "sku"
                        }
                    }
                },
                "sales_order": {
                    "required": [
                        "id",
                        "placed_at",
                        "sales_channel",
                        "payment_method"
                    ],
                    "type": "object",
                    "properties": {
                        "placed_at": {
                            "type": "string",
                            "description": "The date the sales order for this fulfillment order has been placed."
                        },
                        "sales_channel": {
                            "type": "string"
                        },
                        "id": {
                            "type": "string"
                        },
                        "payment_method": {
                            "type": "string"
                        },
                        "invoice_number": {
                            "type": "string"
                        }
                    }
                },
                "locale": {
                    "type": "string",
                    "description": "A String defining the l10n of the fulfillment order"
                },
                "fulfillment_order_id": {
                    "type": "string",
                    "description": "Identifier of the fulfillment order"
                },
                "shipment_order_id": {
                    "type": "string",
                    "description": "Identifier of the shipment order"
                },
                "label": {
                    "type": "string",
                    "description": "Identifier attached by the logistics provider (i.e. quality label)"
                },
                "gross_discounted_price": {
                    "required": [
                        "amount",
                        "currency"
                    ],
                    "type": "object",
                    "description": "Gross product price including any discounts",
                    "properties": {
                        "currency": {
                            "type": "string"
                        },
                        "amount": {
                            "type": "number"
                        }
                    }
                },
                "tax": {
                    "required": [
                        "amount",
                        "currency"
                    ],
                    "type": "object",
                    "description": "Tax amount of the gross discount price",
                    "properties": {
                        "currency": {
                            "type": "string"
                        },
                        "amount": {
                            "type": "number"
                        }
                    }
                },
                "id": {
                    "type": "string",
                    "description": "Identifier of the owning fulfillment order item"
                },
                "suggested_retail_price": {
                    "required": [
                        "amount",
                        "currency"
                    ],
                    "type": "object",
                    "properties": {
                        "currency": {
                            "type": "string"
                        },
                        "amount": {
                            "type": "number"
                        }
                    }
                }
            }
        }
    }
}

{  
   "description":"sales/order_items items inside the event-type sales-order-service.order-placed",
   "type":"object",
   "properties":{  
      "parent_eid":{  
         "format":"uuid",
         "type":"string"
      },
      "parent_metadata_partition":{  
         "type":"string"
      },
      "parent_sales_order_order_number":{  
         "type":"string",
         "example":"10101058747628"
      },
      "value_at_sales_order_items":{  
         "$ref":"#/definitions/SalesOrderItem",
         "type":"object"
      }
   },
   "required":[  
      "parent_eid",
      "parent_metadata_partition",
      "parent_sales_order_order_number",
      "value_at_sales_order_items"
   ],
   "definitions":{  
      "SalesOrderItem":{  
         "type":"object",
         "properties":{  
            "id":{  
               "type":"string",
               "example":"64703279"
            },
            "_links":{  
               "$ref":"#/definitions/Links",
               "example":{  
                  "self":{  
                     "href":"https://sales-order-service.pennybags.zalan.do/api/sales-orders/10101058747628/items/64703279"
                  },
                  "https://docs.pennybags.zalan.do/sales-order":{  
                     "href":"https://sales-order-service.pennybags.zalan.do/api/sales-orders/10101058747628"
                  },
                  "https://docs.pennybags.zalan.do/shipment-order/item":{  
                     "href":"https://sales-order-service.pennybags.zalan.do/api/shipment-orders/7740990016870456/items/768584988634386861"
                  }
               }
            },
            "created_at":{  
               "type":"string",
               "format":"date-time",
               "example":"2015-04-21T12:27:31.000Z"
            },
            "modified_at":{  
               "type":"string",
               "format":"date-time",
               "example":"2015-04-24T13:02:27.000Z"
            },
            "simple_sku":{  
               "type":"string",
               "example":"BU311B01W-1040040000"
            },
            "config_sku":{  
               "type":"string",
               "example":"BU311B01W-104"
            },
            "gross_retail_price":{  
               "$ref":"#/definitions/Money",
               "example":{  
                  "amount":69.9,
                  "currency":"EUR"
               }
            },
            "gross_discounted_price":{  
               "$ref":"#/definitions/Money",
               "example":{  
                  "amount":59.9,
                  "currency":"EUR"
               }
            },
            "gross_discount":{  
               "$ref":"#/definitions/Money",
               "example":{  
                  "amount":-10,
                  "currency":"EUR"
               }
            },
            "suggested_retail_price":{  
               "$ref":"#/definitions/Money",
               "example":{  
                  "amount":79.9,
                  "currency":"EUR"
               }
            },
            "tax":{  
               "$ref":"#/definitions/Money",
               "example":{  
                  "amount":9.57,
                  "currency":"EUR"
               }
            },
            "tax_rate":{  
               "type":"number",
               "format":"double",
               "example":0.19
            }
         }
      },
      "Links":{  
         "type":"object",
         "description":"Values can be either a single Link or an array of Links\nSee https://docs.pennybags.zalan.do/ for more.\n",
         "additionalProperties":{  
            "type":"array",
            "items":{  
               "$ref":"#/definitions/Link"
            }
         },
         "example":{  
            "self":[  
               {  
                  "href":"https://sales-order-service.pennybags.zalan.do/api/sales-orders/10101058747628"
               }
            ]
         }
      },
      "Link":{  
         "type":"object",
         "properties":{  
            "href":{  
               "type":"string",
               "format":"uri",
               "example":"https://sales-order-service.pennybags.zalan.do/api/sales-orders/10101058747628"
            }
         },
         "required":[  
            "href"
         ]
      },
      "Money":{  
         "type":"object",
         "properties":{  
            "amount":{  
               "type":"number",
               "format":"decimal",
               "example":99.95
            },
            "currency":{  
               "type":"string",
               "format":"iso-4217",
               "example":"EUR"
            }
         },
         "required":[  
            "amount",
            "currency"
         ]
      }
   }
}
